import QuoteList from "../components/quotes/QuoteList"

const DUMMY_QUOTES = [
    {id: 'q1', author: 'Dim', test: 'Learning React is fun'},
    {id: 'q2', author: 'Iza', test: 'Learning React is not fun'},
]

const AllQuotes = () => {
    return (
        <QuoteList quotes={DUMMY_QUOTES}/>
    )
}

export default AllQuotes;
